import React, {Component} from 'react'

class Cart extends Component{

render() {
    const products = this.props.cartList.map(e =>  {
        <div className="container">
        <div className="col-xs-12">
        <h1>Your current Cart:</h1>
          <div className = "data">
            <scope className = "row">
            <p className="elements">
             {e.title} {e.description} {e.completed} {e.userId}
            </p>
            </scope>
           </div> 
        )}
        </div>
        </div>
    })
return (
    <div>
        {products}
    </div>
);

}


}
